// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'TopScroll'.
function TopScroll() {
    return (
        // TopScroll Container.
        <>
          
                <button id="TopScroll" onClick={this.scrollToTop} className="animated fadeInRight slow btn btn-info">
                    Back to Top
                </button>
            
        </>
    );
}

// Do export.
export default TopScroll;
